import React, { Component } from 'react';

class Header extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const { user } = this.props;
        return (
            <div>
                {
                    user &&
                    <div className="info">
                        Welcome, {user.name}
                    </div>
                }
            </div>
        )
    }
}

export default Header;
